import Aux from '../../hoc/Auxiliary';
import classes from './Layout.moucss';
import Toolbar from '../Navigation/Toolbar/Toolbar';

const layout = (props) => (
    <Aux>
        <Toolbar></Toolbar>
        <main className={classes.Content}>
            {props.children}
        </main>
    </Aux>
    
);

export default layout;
